select t1.c_int1, t1.c_int2, t1.c_string from (SELECT * FROM (
    SELECT seq2(0) as c_int1, seq1(1) as c_int2, randstr(5, random()) as c_string FROM table(generator(rowCount => 132))
) ORDER BY seq2(0) limit 100 OFFSET 25) as t1 where t1.c_int1 > (select count(*) from tpcds_1_env_uitesting_shared)
